// src/Navbar.js
import React from "react";
import "./Navbar.css";

const Navbar = () => {
  return (
    <div>
      <nav className="navbar">
        <ul>
          <li className="italiana-regular nav-left"> <a href="/">Valentina</a> </li>
          <li className="nav-right"> <a href="/">About Me</a></li>
        </ul>
      </nav>
    </div>
  );
};

export default Navbar;
